import { Injectable } from "@angular/core";
import { HttpClient } from "@angular/common/http";
import { SubDivision } from "src/app/subdivision-data-display/subdivision-data-display.component";

@Injectable()
export class SubdivisionDataDisplayService {
  constructor(private http: HttpClient) {}

  async getAll(pageNum: number, sortField: string, sortType: string) {
    const res = await this.http.get<SubDivision>(
      "http://localhost:3000/v1/subdivisions"
    );
    return this.http.get<SubDivision>("http://localhost:3000/v1/subdivisions");
  }
}
